import React from "react";
import PageHeader from "../../components/PageHeader";


export default function PartnersPage() {
  // header props
  const titleText = "Partners";

  // body images


  return (
    <div>
      <PageHeader title={ titleText } />

      <div >
        <div >
          <div >
            <h1>Corporate Sponsors</h1>
            <h1>Penn Partners</h1>
        </div>
        </div>
      </div>
    </div>
  );
}
